PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE tasks (
	id INTEGER NOT NULL, 
	name VARCHAR(64) NOT NULL, 
	category VARCHAR(64), 
	subcategory1 VARCHAR(64), 
	subcategory2 VARCHAR(64), 
	priority INTEGER NOT NULL, 
	add_date DATETIME NOT NULL, 
	complete_date DATETIME, 
	PRIMARY KEY (id)
);
COMMIT;
